caption.text:
Trimakasih telah mengubah mimpi dan angan itu menjadi sebuah kenyataan :) Semua yang tlah kita korbankan slama ini terasa tidak sia-sia krna hasil yang kita dapat. Terkadang rasa takut akan kekalahan datang, tapi hari ini kita membuktikan kita berani melawan.rasa takut itu.
Senang sekali bisa mengenal kalian semua, walau awalnya btul-btul tal knal satu sama lain.. {}
Satu hal yang kutau, kita semua HEBAT!! Congrats Budi Mulia tercinta ;*
